import 'package:flutter/material.dart';
import 'dart:convert';
import 'dart:typed_data';

class Product {
  final int id;
  final String title;
  final int price;
  final int size;
  final String description;
  final String image;
  final Color color;

  Product({
    required this.id,
    required this.title,
    required this.price,
    required this.size,
    required this.description,
    required this.image,
    required this.color,
  });

  Map<String, dynamic> toMap() => {
        'id': id,
        'title': title,
        'price': price,
        'size': size,
        'description': description,
        'image': image, 
        'color': color.value,
      };

  factory Product.fromMap(Map<String, dynamic> map) => Product(
        id: map['id'],
        title: map['title'],
        price: map['price'],
        size: map['size'],
        description: map['description'],
        image: map['image'],
        color: Color(map['color']),
      );

  Uint8List get imageBytes => base64Decode(image);
}

